SELECT MIN(person_info.note), MIN(title.episode_nr), MIN(link_type.link), MIN(comp_cast_type.id), MIN(comp_cast_type.kind), MIN(title.id), MIN(keyword.keyword), MIN(complete_cast.status_id), MIN(cast_info.movie_id), MIN(kind_type.kind), MIN(aka_title.movie_id), MIN(name.name), MIN(name.name_pcode_cf), MIN(movie_info.movie_id), MIN(company_name.name), MIN(movie_companies.movie_id), MIN(title.production_year), MIN(movie_info.note), MIN(info_type.info), MIN(char_name.name) FROM name, title, movie_info, link_type, movie_companies, cast_info, kind_type, aka_title, info_type, person_info, complete_cast, keyword, char_name, company_name, comp_cast_type WHERE person_info.note != 'A. Nonymous' AND title.episode_nr > 20385 AND link_type.link IN ('remade as', 'unknown link', 'spin off', 'alternate language version of', 'similar to', 'version of', 'featured in', 'edited from', 'spoofed in', 'spoofs', 'features', 'followed by', 'follows', 'edited into', 'referenced in', 'references', 'spin off from', 'remake of') AND company_name.name = 'Walt Disney Studios Motion Pictures' AND char_name.name != 'Herself' AND info_type.info = 'LD audio noise' AND comp_cast_type.kind = 'complete' AND movie_info.note != '(New York City, New York)' AND kind_type.kind IN ('video game', 'episode', 'movie', 'tv movie', 'video movie', 'tv series', 'tv mini series') AND name.name IS NOT NULL AND title.production_year >= 1890 AND name.name_pcode_cf IN ('R1632', 'T5125', 'B341', 'Q1323', 'S5351', 'O6254', 'A5362', 'B6525', 'G5242', 'H6514', 'P6252', 'P3625', 'S3152', 'Y6415', 'A5315', 'M6352', 'J5252', 'I326', 'D3453', 'D5254') AND keyword.keyword IS NOT NULL AND comp_cast_type.id = complete_cast.status_id AND title.id = aka_title.movie_id AND movie_info.movie_id = cast_info.movie_id AND movie_info.movie_id = movie_companies.movie_id;